// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract UnstoppableTweets {
    struct Tweet {
        string text;
        address user;
    }

    mapping(address => string) public userNames;

    Tweet[] public tweets;

    /// Your message has more than `limit` limit bytes;
    error MessageExceedCharacterLimit(uint16 limit);

    /// A username was not created for the address
    error UsernameNotCreated();

    modifier smallerThanBytes(string calldata input, uint16 size) {
        if (bytes(input).length > size) revert MessageExceedCharacterLimit(size);
        _;
    }

    function getAllTweets() public view returns (Tweet[] memory) {
        return tweets;
    }

    function createNewUserName(string calldata username) external smallerThanBytes(username, 50) {
        userNames[msg.sender] = username;
    }

    function hasUserName(address adr) public view returns (bool) {
        return (bytes(userNames[adr]).length > 0);
    }

    function createNewTweet(string calldata message) external smallerThanBytes(message, 150) {
        if (!hasUserName(msg.sender)) revert UsernameNotCreated();
        tweets.push(Tweet({ text: message, user: msg.sender }));
    }

    constructor() {}
}

